    public static void init2P(){
        String sTmp = "";
        String sNum = "";
        int k = 0;
        for (int i = 0; i<100; i++) {
            if(i<10){
                sNum = "0"+i;
            }else {
                sNum = ""+i;
            }
            sTmp = "X" +  sNum.substring(0,1) + "X" + sNum.substring(1,2);
            ARRAY_2P[k++] = sTmp;
            sTmp = "X" +  sNum.substring(0,1) + sNum.substring(1,2)  + "X" ;
            ARRAY_2P[k++] = sTmp;
            sTmp = sNum.substring(0,1) + "X" + sNum.substring(1,2) + "X";
            ARRAY_2P[k++] = sTmp;
            sTmp = "XX" +  sNum.substring(0,1) + sNum.substring(1,2);
            ARRAY_2P[k++] = sTmp;
            sTmp = sNum.substring(0,1) + "XX" + sNum.substring(1,2);
            ARRAY_2P[k++] = sTmp;
            sTmp = sNum.substring(0,1) + sNum.substring(1,2) + "XX";
            ARRAY_2P[k++] = sTmp;
        }
    }


    public static void init3P() {
        String sTmp = "";
        String sNum = "";
        int k = 0;
        for (int i = 0; i<1000; i++) {
            sNum = ""+i;
            if(i<10){
                sNum = "0"+ sNum;
            }
            if(i<100){
                sNum = "0"+ sNum;
            }

            sTmp = sNum.substring(0,1) + sNum.substring(1,2) + sNum.substring(2, 3)+ "X";
            ARRAY_3P[k++] = sTmp;
            sTmp = sNum.substring(0,1) + sNum.substring(1,2)+ "X" + sNum.substring(2, 3);
            ARRAY_3P[k++] = sTmp;
            sTmp = sNum.substring(0,1) + "X" + sNum.substring(1,2) + sNum.substring(2, 3);
            ARRAY_3P[k++] = sTmp;
            sTmp = "X" +  sNum.substring(0,1) + sNum.substring(1,2) + sNum.substring(2, 3);
            ARRAY_3P[k++] = sTmp;
        }
    }

    public static void init4P() {
        String sNum = "";
        int k = 0;
        for (int i = 0; i<10000; i++) {
            sNum = ""+i;
            if(i<10){
                sNum = "0"+ sNum;
            }
            if(i<100){
                sNum = "0"+ sNum;
            }
            if(i<1000){
                sNum = "0"+ sNum;
            }
            ARRAY_4P[k++] = sNum;
        }
    }

    public static void init2PX(){
        int k = 0;
        for (int i = 0; i < 10; i++) {
            for (int j = i; j < 10; j++) {
                ARRAY_2PX[k++] = "" + i + j;
            }
        }
    }

    //220
    public static void init3PX(){
        int k = 0;
        for (int i = 0; i < 10; i++) {
            for (int j = i; j < 10; j++) {
                for (int m = j; m < 10; m++) {
                    ARRAY_3PX[k++] = "" + i + j + m;
                }
            }
        }
    }

    //715
    public static void init4PX(){
        int k = 0;
        for (int i = 0; i < 10; i++) {
            for (int j = i; j < 10; j++) {
                for (int m = j; m < 10; m++) {
                    for (int n = m; n < 10; n++) {
                        ARRAY_4PX[k++] = "" + i + j + m + n;
                    }
                }
            }
        }
    }


